import antfu from '@antfu/eslint-config'

export default antfu({
  rules: {
    'no-use-before-define': 'off',
    'node/prefer-global/process': 'off',
    'ts/no-use-before-define': 'off',
    'ts/prefer-ts-expect-error': 'off',
  },
  // exclude examples dir
  ignores: [
    'test/*',
    'examples/*',
    'examples/**/*.*',
  ],
})

{
  "name": "@unlighthouse/monorepo",
  "type": "module",
  "version": "0.15.0",
  "private": true,
  "packageManager": "pnpm@9.15.2",
  "license": "MIT",
  "scripts": {
    "cli": "JITI_ESM_RESOLVE=1 node packages/cli/dist/cli.mjs",
    "ci": "JITI_ESM_RESOLVE=1 node packages/cli/dist/ci.mjs",
    "ci:docs": "node packages/cli/dist/ci.mjs --site unlighthouse.dev --build-static --debug",
    "build": "pnpm run build:pkg",
    "build:docs": "cd docs && pnpm i && nuxi build",
    "build:pkg": "pnpm -r --filter=./packages/** run build",
    "stub": "JITI_ESM_RESOLVE=true && pnpm -r --parallel run stub",
    "lint": "eslint . --fix",
    "release": "bumpp package.json packages/*/package.json --commit --push --tag",
    "test": "vitest",
    "test:update": "vitest -u",
    "docs": "npm -C docs run dev",
    "docs:build": "npm -C docs run build",
    "docs:serve": "npm -C docs run serve"
  },
  "devDependencies": {
    "@antfu/eslint-config": "^3.12.1",
    "bumpp": "^9.9.2",
    "eslint": "^9.17.0",
    "typescript": "5.7.2",
    "unbuild": "^3.2.0",
    "vite": "^6.0.6",
    "vitest": "^2.1.8"
  },
  "pnpm": {
    "packageExtensions": {
      "puppeteer-cluster": {
        "peerDependencies": {
          "puppeteer-core": "*"
        },
        "peerDependenciesMeta": {
          "puppeteer": {
            "optional": true
          }
        }
      }
    }
  }
}

import type { AliasOptions } from 'vite'
import { resolve } from 'node:path'
import { defineConfig } from 'vite'

const r = (p: string) => resolve(__dirname, p)

export const alias: AliasOptions = {
  'unlighthouse': r('./packages/core/src/'),
  '@unlighthouse/client': r('./packages/client/src/'),
}

export default defineConfig({
  test: {
    testTimeout: 3000000,
  },
  resolve: {
    alias,
  },
})
